import Register from "./Register/Register.js";
import Login from "./Login/Login.js";
import { Container, Col, Row } from "react-bootstrap";
import React from "react";

export function Account() {
	return (
		<Container>
			<Row>
				<Col xs={12} sm={12} md={6} lg={6}>
					<Register />
				</Col>
				<Col xs={12} sm={12} md={6} lg={6}>
					<Login />
				</Col>
			</Row>
		</Container>
	);
}
